export function createScatterPoints(data){
    return data.map(d=>{
        let c;
        if (isNaN(d.pert_dose) ){
            c = d.pert_dose
        } else {
            c = +d.pert_dose
        }
        return {
            x: +d.effect_size,
            y: +d["q.value"],
            r: 6,
            c: c,
            _info: d
        }
    })
}
